import React from "react";
import styles from "./RoadmapFilters.module.css";

export const RoadmapFilters = () => {
  const filters = ["Planned", "In-Progress", "Live"];
  return (
    <div className={styles["roadmap__filters"]}>
      {filters.map((filter) => (
        <button
          className={`${styles["roadmap__filter"]} ${styles["roadmap__filter--selected"]}`}
        >
          {filter} (2)
        </button>
      ))}
    </div>
  );
};
